const PRECISION = 0.00001; // numbers less than this is considered as 0

/**
 * 判断两个数是否相等
 * @return 是否相等
 */
export default function isNumberEqual(a: number, b: number, precision: number = PRECISION): boolean {
  return a === b || Math.abs(a - b) < precision;
}
